import * as axios from 'axios';

const instance = axios.create({
    baseURL: "http://localhost/superheroes/back/",
});

export const heroApi = {
    getHeroes(pageNumber, pageSize){
        return instance.get(`?page=${pageNumber}&count=${pageSize}`)
        .then(response => response.data)
        .then(response => {
            console.log(response);
        })
    }
}
